import React from 'react'
import { Col, Row } from 'react-bootstrap';

 const Employes = ({data}) => {
  return (
   <Row>
      <Col>
          <div>
            {
                data.length ? (data.map()) : <h2>No Employee</h2>
            }
          </div>
      </Col>
   </Row>
  )
}
export default Employes;
